import React from "react";
import cliente from "../assets/images/client/client1.png"

const Menu = () =>{
    return (
        <>
            {/*clients start*/}
            <section className="clients">
                <div className="container">
                <div className="clients-area">
                    <div className="owl-carousel owl-theme" id="client">
                    <div className="item">
                        <a href="#">
                        <img src={cliente} alt="brand-image" />
                        </a>
                    </div>
                    {/*/.item*/}
                    <div className="item">
                        <a href="#">
                        <img src="assets/images/client/client2.png" alt="brand-image" />
                        </a>
                    </div>
                    {/*/.item*/}
                    <div className="item">
                        <a href="#">
                        <img src="assets/images/client/client3.png" alt="brand-image" />
                        </a>
                    </div>
                    {/*/.item*/}
                    <div className="item">
                        <a href="#">
                        <img src="assets/images/client/client4.png" alt="brand-image" />
                        </a>
                    </div>
                    {/*/.item*/}
                    <div className="item">
                        <a href="#">
                        <img src="assets/images/client/client5.png" alt="brand-image" />
                        </a>
                    </div>
                    {/*/.item*/}
                    </div>
                    {/*/.owl-carousel*/}
                </div>
                {/*/.clients-area*/}
                </div>
                {/*/.container*/}
            </section>
            {/*/.clients*/}
            {/*clients end*/}
            </>

    )
}
export default Sponsor;
